import React from 'react';

import { useState, useEffect } from 'react';

import LiftConsoleButton from './lift_console_button';
import Card from 'react-bootstrap/Card';

const Fetch = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch('http://127.0.0.1:8000//api/lift/config/')
      .then((res) => {
        console.log(res)
        return res.json();
      })
      .then((data) => {
        console.log(data["lifts"]);
        let avaliable_floors = [];
        for (let lift of data["lifts"]){
            console.log("HERE" + data["lifts"])
            avaliable_floors = avaliable_floors.concat(lift.filter(item2 =>
                !avaliable_floors.some(item1 => item1.id === item2.id)
            ));
        }
        console.log(avaliable_floors);
        setData(data["lifts"]);
      });
  }, []);
  return ( <div>
        {data.map((lift, index) => ( 
            <Card>
                <Card.Body>
                    <Card.Title>Lift Console number {index}</Card.Title>
                        {lift["serviced_floors"].map((floor) => ( <LiftConsoleButton index={floor}/>))}
                </Card.Body>
            </Card>
        )) } </div>
        )
};
export default Fetch;
